import React from 'react';


function TodoList(props) {

  return (
    <div>
        {
            props.products.map((todoitem) => {
                return (
                    <>
                <li>{todoitem.todo}</li>
                <button className='btn btn-primary m-1' onClick={() => props.editProduct(todoitem)}>Edit</button>
                <button className="btn btn-danger m-1" onClick={() => props.deleteProduct(todoitem.id)}>Delete</button>
                </>
            )
            })
        }
    </div>
  )
}

export default TodoList
